import React from 'react';
import {NavLink} from "react-router-dom";   

function Nav({user}){

    return(
        <>
            {/* <button>My Clubs</button> */}
            <NavLink exact to="/profile">
            <button>My Profile</button>
            </NavLink>
            <NavLink exact to="/clubsearch">
                <button>Club Search</button>
            </NavLink>
            <NavLink exact to="/booksearch">
                <button>Book Search</button>
            </NavLink>
            <NavLink exact to="/">
                <button onClick={clickHandler}>{user === {} ? "Log In" : "Log Out"}</button>
            </NavLink>
        </>
    )
}
export default Nav;
